import React, { useState } from "react";


const time = new Date();
const curHour = time.getHours();
const [hour, setHour] = useState(curHour);

const curMin = time.getMinutes();
const [minutes, setMin] = useState(curMin);

const curSec = time.getSeconds();
const [Sec, setSec] = useState(curSec);

const IncNum = ()=>{
  const newTime = new Date();
  setHour(newTime.getHours());
  setMin(newTime.getMinutes());
  setSec(newTime.getSeconds());
}

const App = ()=>{
  return (
    <>
      <h1> {hour}:{minutes}:{Sec} </h1>
      <button onClick={IncNum}>Get Time</button>
    </>
  );
};

export default App;
